/**
 * @name You're Muted
 * @author josh#7745
 * @description Notifies you when you've had yourself muted for a while
 * @version 1.0.0
 */
module.exports = class YoureMuted {
    meta = {
        name: "YoureMuted"
    }

    settings = {
        secsMutedBeforeDingaling: 30
    }

    start() {
        // Load settings
        Object.assign(this.settings, BdApi.loadData(this.meta.name, "settings"));

        // Setup audio
        this.dingDongAudio = new Audio("data:audio/mpeg;base64,");

        // Find the mute button
        let muteButtons = document.querySelectorAll('[aria-label="Mute"]');
        if (muteButtons.length != 1) {
            console.error("Failed to load. Couldn't find the mute button.");
            return;
        }
        this.muteButton = muteButtons[0];

        // Setup an observer
        this.muteButtonObserver = new MutationObserver((mutations) => {
            mutations.forEach((mutation) => {
                if (mutation.type == 'attributes') {
                    let isMuted = (this.muteButton.getAttribute(mutation.attributeName) === 'true');
                    if (isMuted) {
                        this.mutedTimer = setInterval(this.dingDong.bind(this), this.settings.secsMutedBeforeDingaling * 1000);
                        console.log("dinger armed");
                    } else {
                        this.disarmInterval();
                    }
                }
            });
        });

        // Watch the mute button
        this.muteButtonObserver.observe(this.muteButton, {
            attributeFilter: ['aria-checked']
        });
    }
    
    stop() {
        this.muteButtonObserver.disconnect();
        this.disarmInterval();
    }

    dingDong() {
        console.log("ding");
        this.dingDongAudio.play();
    }

    disarmInterval() {
        if (this.mutedTimer) {
            console.log("dinger disarmed");
            clearInterval(this.mutedTimer);
        }
    }

    buildSetting(text, key, type, value, callback = () => {}) {
        const setting = Object.assign(document.createElement("div"), {className: "setting"});
        const labelEl = document.createElement("span");
        labelEl.style.color = "var(--header-secondary)"
        const label = Object.assign(labelEl, {textContent: text});
        const inputEl = document.createElement("input");
        inputEl.style.marginLeft = '2em';
        const input = Object.assign(inputEl, {type: type, name: key, value: value});
        if (type == "checkbox" && value) input.checked = true;
        input.addEventListener("change", () => {
            const newValue = type == "checkbox" ? input.checked : input.value;
            this.settings[key] = newValue;
            BdApi.saveData(this.meta.name, "settings", this.settings);
            callback(newValue);
        });
        setting.append(label, input);
        return setting;
    }

    getSettingsPanel() {
        const settingsPanel = document.createElement("div");
        settingsPanel.id = "muted-reminder-settings";

        const secsMutedText = this.buildSetting("Seconds Before Notification", "secsMutedBeforeDingaling", "text",
                                                this.settings.secsMutedBeforeDingaling, () => {});

        settingsPanel.append(secsMutedText);
        return settingsPanel;
    }

}
